import React from "react";
import PageLoader from './pages/index'
import LoadCustomRouter from './pages/Router'

function App() {
	return (
		<div>
			<div>
				<LoadCustomRouter>
					<PageLoader />
				</LoadCustomRouter>
			</div>
		</div>
	);
}

export default App;
